import React, { useEffect, useState } from "react";
// import UserData from "./UserData";

const Table = ({userData}) => {
  const [data, setData] = useState([]);

  

  useEffect(() => {
    fetch("http://localhost:8005/getAllUser",{
    method:'GET'
    })
        .then((res)=>res.json())
        .then((data)=>{
            console.log(data,"userData")
            setData(data.data)
        })
  }, []);

  return (
    <>
      <table cla>
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Income</th>
            <th>City</th>
            <th>Car</th>
            <th>Quote</th>
            <th>Phone price</th>
          </tr>
        </thead>
        <tbody>
          {data.map((d)=>{
            return(
                <tr>
                    <td>{d.id}</td>
                    <td>{d.first_name}</td>
                    <td>{d.last_name}</td>
                    <td>{d.email}</td>
                    <td>{d.income}</td>
                    <td>{d.city}</td>
                    <td>{d.car}</td>
                    <td>{d.quote}</td>
                    <td>{d.phone_price}</td>
                </tr>
            )
          })}
        </tbody>
      </table>
    </>
  );
};

export default Table;
